description:
Verenigde Staten / Verenigd Koninkrijk
Drama / Avontuur
94 minuten

goed

met James Franco, Amber Tamblyn en Kate Mara

'127 Hours' vertelt het waargebeurde verhaal van bergbeklimmer Aron Ralston (James Franco). Tijdens een tocht in de 
woestijnachtige bergen van Moab, in Utah komt zijn arm onder een grote rots terecht waardoor hij klem komt te zitten in een 
diepe kloof. Aron heeft niemand verteld dat hij de bergen in is gegaan, waardoor er weinig hoop lijkt op een eventuele redding. 
Voor zijn ongeval ontmoette Aron nog wel twee bergwandelaars (Kate Mara &amp; Amber Tamblyn). Zijn zij de laatste mensen die Aron 
ontmoette?
